import Footer from "../components/Footer";
import HeaderIT from "../components/HeaderIT";
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import { CardImg } from "react-bootstrap";
import { CardBody } from "@chakra-ui/react";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function NewsIT() {
    return (
        <>
            <HeaderIT />
            <section id='news'>
                <Container>
                    <Row className="align-items-center justify-content-center">
                        <Col lg={6} md={12}>
                            <Card>
                                <CardImg className='img-fluid' variant="top" src={`${require('../images/news-2.jpeg')}`} />
                                <Card.Body>
                                    <Card.Text>
                                        Ristorante Galleria si aggiudica il prestigiosissimo riconoscimento di “Insegna storica e di tradizione” della Regione Lombardia
                                    </Card.Text>
                                </Card.Body>
                            </Card>
                        </Col>
                        <Col lg={6} md={12}></Col>
                    </Row>
                </Container>
            </section>
            <Footer />
        </>
    );
}

export default NewsIT;
